2.1 <COMPANY>The right</COMPANY:

2.1.1 to exhibit/make available from any place each film and/or programme (the <PRODUCT>Title</PRODUCT>) in the <TERRITORY>Territory</TERRITORY> in any Format and on any Sky Service and delivered to any Viewing Device by all forms of Electronic Transmission by the <RIGHTS>Exhibition Rights</RIGHTS> set out in the Deal Terms;

2.1.2 when exhibiting a <PRODUCT>Title</PRODUCT> on a PPV and/or TVOD basis to offer the <PRODUCT>Title</PRODUCT> on a single viewing or single Buy basis or on a multiplay basis (which enables the viewer to view the <PRODUCT>Title</PRODUCT> over a limited period of time);

2.1.3 to exhibit each <PRODUCT>Title</PRODUCT> to an audience by means of closed circuit distribution, including on <TERRITORY>airlines, coaches and ships</TERRITORY>;

2.1.4 to facilitate access to and the <RIGHTS>right for the viewer to copy linear recordings of each Title recorded on Sky STBs to non-Sky STB devices</RIGHTS>;

2.1.5 to offer free access to each <PRODUCT>Sky Service</PRODUCT> at its sole discretion;

2.1.6 to enable onward transmission of each <PRODUCT>Title</PRODUCT> from any <PRODUCT>Sky STB</PRODUCT> to other <PRODUCT>Sky STBs</PRODUCT> or to other <PRODUCT>Viewing Devices</PRODUCT>;

2.1.7 to use and deploy <PRODUCT>PVR Functionality</PRODUCT>; and

2.1.8 to exhibit each <PRODUCT>Title</PRODUCT> for promotional or educational screenings or on premises owned, leased or hired by <COMPANY>Sky</COMPANY> for the purposes of showcasing forthcoming content on <COMPANY>Sky’s</COMPANY> products and services, audiences who have not paid for admission (within to the meaning of the <LEGAL>Copyright Designs and Patents Act 1988</LEGAL>);

2.2 Where the Number of <TERM>Exhibition Weeks</TERM> is limited:

2.2.1 <PARTY>Sky</PARTY> shall not be entitled to exhibit each <PRODUCT>Title</PRODUCT> for any longer than the <TERM>Number of Exhibition Weeks</TERM>;

2.2.2 a simultaneous retransmission by <COMPANY>Sky</COMPANY> and/or third parties of the signal of any <PRODUCT>Sky Service</PRODUCT> on which each Title is exhibited (a) by different means of <RIGHTS>Electronic Transmission</RIGHTS>; (b) different <RIGHTS>Exhibition Rights</RIGHTS>; (c) in different Formats, and/or (d) on a timeshifted version of any <PRODUCT>Sky Service</PRODUCT> shall count as the same one exhibition;

2.2.3 the Number of Exhibition Weeks shall apply separately for each different <PRODUCT>media</PRODUCT> used to deliver any <COMPANY>Sky Service</COMPANY> on which each <ID>Title</ID> is exhibited; and

2.2.4 an exhibition of a <PRODUCT>Title</PRODUCT> by way of EST, PPV, TVOD and/or SVOD shall not count as an exhibition for the purposes of the <ID>Number of Exhibition Weeks</ID>.

3. <COMPANY>EDITORIAL RIGHTS</COMPANY

3.1 The <RIGHTS>right</RIGHTS> to:

3.1.1 cut and edit the <PRODUCT>Titles</PRODUCT> for the purposes of: (a) compliance with any <LEGAL>laws and regulations</LEGAL>; (b) meeting censorship requirements and guidelines; (c) programming timing needs; and (d) any relevant contractual obligations of <PARTY>Licensor</PARTY> to third parties as notified in writing to <COMPANY>Sky</COMPANY> by <PARTY>Licensor</PARTY> by the <DATE>Delivery Date</DATE>, save that <COMPANY>Sky</COMPANY> shall not be liable for any casual or inadvertent failure to comply with any such notification;

3.1.2 <RIGHTS>re-title, re-voice and change the names of any characters in the Titles;</RIGHTS>

3.1.3 <RIGHTS>technically manipulate (e.g. digitise, encode and compress) the Titles and convert the Materials into different Formats (e.g. a SD Master into a HD Master or a 3D Master into a HD Master, up-res or down-res);</RIGHTS>

3.1.4 <PRODUCT>subtitle</PRODUCT> (inclusion of text, signing, and/or audio description in the Titles) and exhibit subtitled versions of the <PRODUCT>Titles</PRODUCT>:

(a) in accordance with the <LEGAL>Ofcom Code on Television Access Services</LEGAL>;

(b) in the official languages of the <TERRITORY>Territory</TERRITORY> only and in accordance with dialogue list provided by <PARTY>Licensor</PARTY>; and

(c) subject to any <PARTY>third party</PARTY> contractual requirements notified to <COMPANY>Sky</COMPANY> on or before the <DATE>Delivery Date</DATE>;

3.1.5 include or deploy in connection with the exploitation of the <PRODUCT>Titles</PRODUCT> additional functionality including: (a) icons (including the “red button” application); navigational tools including EPG functionality; (c) other digital enhanced applications including digital text and screen shrinkage; and (d) Interactive Services; (b)

3.1.6 include channel bugs (static logos) during the exhibition of the <PRODUCT>Titles</PRODUCT>;

3.1.7 insert reasonable statements and apologies about transmission quality; and

3.1.8 in respect of Titles which are longer than sixtyminutes in duration and subject to the provisions of this <LEGAL>Clause</LEGAL>, transmit those Titles in two parts on successive days or in successive weeks at its discretion, such a split transmission being counted as one exhibition for the Title when both parts have been transmitted. A Title presented under the provisions of this <LEGAL>Clause</LEGAL> shall be presented, billed and listed as Part One and Part Two of that Title under its normal title and shall not be otherwise altered or edited subject to <LEGAL>Clause 3</LEGAL>.
